    "devils-lake-wetland-management-district-annual-narrative-report-calendar-year-1993",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Devil's
    Lake Wetland Management District, Lake Alice National Wildlife Refuge, Sullys Hill
    National Game Preserve, and the satellite easement refuges outlines Refuge accomplishments
    during the 1993 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the public participation, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, grazing, haying, fire management,
    pest control, water rights, wilderness areas, and WPA easement monitoring. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory birds,
    game mammals, other resident wildlife, wildlife propagation and stocking, animal
    control, marking and banding, and disease prevention and control. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, trapping, wildlife observation, off-road vehicling,
    other wildlife oriented recreation, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    equipment utilization and replacement, computer systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"license_title":
